import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import './UserDetails.scss';
import { getActionsFormate } from '../../utils/common';
import ACTIONS from '../../apiConfig/actions.constants';
import UserInfo from '../../components/UserInfo/UserInfo';
import { COMPONENTS } from '../../utils/constants';


class UserDetails extends React.Component{
  constructor(props){
    super(props);
  }

  componentDidMount(){
    const {getUserDetials} = this.props;
    const { params } = this.props.match;
    const type = ACTIONS.USERS.GET_USER_INFO
    getUserDetials(type, {...params});
  }

  render(){
    return (
      <UserInfo {...this.props[COMPONENTS.USER]} />
    );
  }
}

UserDetails.propTypes = {
  data: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired
};

const mapStateToProps = (state) =>({
  [COMPONENTS.USER]: state.userDetailsReducerStore[COMPONENTS.USER]
})

const mapDispatchToProps = dispatch => {
  return {
    getUserDetials: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
}

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(UserDetails)
);
